  false,\n\t\"url\": null,\n\t\"notes\": \"This Narrative Report for Malheur National
  Wildlife Refuge covers May through August of 1958.  The report begins with general
  information about the refugeu2019s weather and habitat conditions for the year.
  \ Wildlife is discussed in the following section.  Animals of interest include migratory
  birds, upland game birds, big game animals, fur animals, predators, rodents, hawks,
  eagles, and fish.  Refuge maintenance and development activities are covered, including
  physical developments, plantings, collections and receipts, vegetation control,
  planned burning, and fire.  Resource management is also discussed; resources include
  grazing and fur harvest.  A progress report on field investigations and research
  is provided.  Public relations is covered; topics include refuge visitors and refuge
  participation.  Finally, items of interest and pictures are provided.\",\n\t\"license_title\":
